import React from 'react';
import './App.css';
import Section from './Section'

// Function Keywords(props) {
//   return (
//     <li> {props.data.keywords} </li>
//   );
// }

function Keywords(props) {
  console.log(props.data.keywords);
	return (
  	<li> Keywords: {props.data.keywords}</li>
  );
}

class Course extends React.Component {
  // do I need constructor here?
  // difference between props & state
  // how to display the data on the screen

  render() {
    // console.log(this.props.data);
    return (
      <div>
        <h1> <b>({this.props.data.number}) {this.props.data.name}</b> | ({this.props.data.credits} Credits)</h1>
        <h3> <b>Subject</b>: {this.props.data.subject} </h3>
        <h4> {this.props.data.description} </h4>
        <h3> <b>Requisites</b>: {this.props.data.requisites} </h3>
        <Keywords/>
      </div>
    )
  }
}

export default Course;
